import './Men.css';
import HomePage from "./HomePage";


function Men(){
    return(
        <>
       <HomePage/>
       <div className="men-section">
         <div className="container">
            <div className="collection-heading">
              SHOP BY FANDOM 
            </div>

         </div>

       </div>
        </>
    );

  
}
export default Men ;
